import { Component } from 'react'
import './index.css'

const diseasesList=[
    {
      id:1,
      name:"White Spot Syndrome (WSS)",
      diseaseImg:"https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg"
    },{
      id:2,
      name:'Yellow Head Disease (YHD)',
      diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
    },{
      id:3,
      name:"Vibriosis",
      diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
    },{
      id:4,
      name:'Black Gill Disease',
      diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
    },{
      id:5,
      name:'Taura Syndrome',
      diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
    },{
      id:6,
      name:"Infectious Hypodermal and Hematopoietic Necrosis (IHHN)",
      diseaseImg:'https://i.pinimg.com/736x/93/12/60/931260aa76f5ef8af9a2173b4298ffb1.jpg'
    }
  ]

class Disease extends Component{
    
    render(){
        return(
            <div className="disease-container">
                <h1 className='Disease-heading'>Diseases</h1>
                <ul className='card-container'>
                    {diseasesList.map((each)=>(
                        <li className='disease-card'>
                            <img className='card-image' src={each.diseaseImg} alt='disease-image' />
                            <p className='disease-name'>{each.name}</p>
                            <button className='button'>View</button>
                        </li>
                    ))}
                </ul>
            </div>
        )

    }
}

export default Disease;
